import React from "react";
import axios from "axios";
import Applications_made_component from "../../components/job_application/Applications";



class ApplicationMadeList extends React.Component {
  state = {
    applicationsmade: []
  };

  fetchApplicants = () => {
    axios.get("http://127.0.0.1:8000/api_application/Application_made/").then(res => {
      this.setState({
        applicationsmade: res.data
      });
    });
  }

  componentDidMount() {
    this.fetchApplications_made_component();
  }

  componentWillReceiveProps(newProps) {
    if (newProps.token) {
      this.fetchApplications_made_component();      
    }
  }

  render() {
    return (
      <div>
        <Applications_made_component data={this.state.applicationsmade} /> <br />




      </div>
    );
  }
}

export default ApplicationMadeList;
